// Universal SE Ranking Data Formatter - FINAL FIX
const allInput = $input.all();
const timestamp = new Date().toISOString().split('T')[0];

// Get the actual data
let data;
if (allInput.length > 0) {
  data = allInput[0].json;
} else {
  data = $input.first().json;
}

let output = [];

if (!data) {
  output = [{ json: { date: timestamp, error: 'No data' } }];
} 
// Check if it's the top-level object with organic/adv
else if (data.organic && data.adv) {
  const organic = data.organic;
  const adv = data.adv;

  // Check if organic is an array (multi-region) or object (single region)
  if (Array.isArray(organic)) {
    // MULTI-REGION: organic and adv are arrays
    organic.forEach(region => {
      output.push({
        json: {
          date: timestamp,
          data_type: 'regional_organic',
          source: region.source,
          country: region.country,
          keywords_count: region.keywords_count || 0,
          traffic_sum: region.traffic_sum || 0,
          price_sum: region.price_sum || 0,
          positions_new: region.positions_new_count || 0,
          positions_up: region.positions_up_count || 0,
          positions_down: region.positions_down_count || 0,
          positions_lost: region.positions_lost_count || 0,
          positions_equal: region.positions_equal_count || 0,
          top_1_5: region.positions_tops?.top1_5 || 0,
          top_6_10: region.positions_tops?.top6_10 || 0,
          top_11_20: region.positions_tops?.top11_20 || 0,
          top_21_50: region.positions_tops?.top21_50 || 0,
          top_51_100: region.positions_tops?.top51_100 || 0
        }
      });
    });

    adv.forEach(region => {
      output.push({
        json: {
          date: timestamp,
          data_type: 'regional_paid',
          source: region.source,
          country: region.country,
          keywords_count: region.keywords_count || 0,
          traffic_sum: region.traffic_sum || 0,
          price_sum: region.price_sum || 0,
          positions_new: region.positions_new_count || 0,
          top_1_2: region.positions_tops?.top1_2 || 0,
          top_3_5: region.positions_tops?.top3_5 || 0,
          top_6_8: region.positions_tops?.top6_8 || 0,
          top_9_11: region.positions_tops?.top9_11 || 0
        }
      });
    });
  } else {
    // SINGLE REGION: organic and adv are objects
    output.push({
      json: {
        date: timestamp,
        data_type: 'domain_summary',
        domain: organic.base_domain || adv.base_domain || '',
        year: organic.year || 0,
        month: organic.month || 0,
        // Organic
        organic_keywords: organic.keywords_count || 0,
        organic_traffic: organic.traffic_sum || 0,
        organic_value: organic.price_sum || 0,
        organic_new: organic.keywords_new_count || 0,
        organic_up: organic.keywords_up_count || 0,
        organic_down: organic.keywords_down_count || 0,
        organic_lost: organic.keywords_lost_count || 0,
        organic_equal: organic.keywords_equal_count || 0,
        organic_top_1_5: organic.top1_5 || 0,
        organic_top_6_10: organic.top6_10 || 0,
        organic_top_11_20: organic.top11_20 || 0,
        organic_top_21_50: organic.top21_50 || 0,
        organic_top_51_100: organic.top51_100 || 0,
        // Paid
        paid_keywords: adv.keywords_count || 0,
        paid_traffic: adv.traffic_sum || 0,
        paid_value: adv.price_sum || 0,
        paid_new: adv.keywords_new_count || 0,
        paid_top_1_2: adv.top1_2 || 0,
        paid_top_3_5: adv.top3_5 || 0,
        paid_top_6_8: adv.top6_8 || 0,
        // Totals
        total_keywords: (organic.keywords_count || 0) + (adv.keywords_count || 0),
        total_traffic: (organic.traffic_sum || 0) + (adv.traffic_sum || 0),
        total_value: (organic.price_sum || 0) + (adv.price_sum || 0)
      }
    });
  }
}
// Check if it's an array (keywords or competitors)
else if (Array.isArray(data)) {
  if (data.length === 0) {
    output = [{ json: { date: timestamp, message: 'Empty array' } }];
  } else {
    const first = data[0];

    // Keywords
    if (first.keyword && first.position !== undefined) {
      output = data.map(kw => ({
        json: {
          date: timestamp,
          data_type: 'keyword',
          keyword: kw.keyword,
          position: kw.position || 0,
          prev_position: kw.prev_pos || 0,
          volume: kw.volume || 0,
          cpc: kw.cpc || 0,
          difficulty: kw.difficulty || 0,
          url: kw.url || '',
          traffic: kw.traffic || 0,
          block: kw.block || ''
        }
      }));
    }
    // Competitors
    else if (first.domain && first.common_keywords !== undefined) {
      output = data.map(comp => ({
        json: {
          date: timestamp,
          data_type: 'competitor',
          domain: comp.domain,
          common_keywords: comp.common_keywords || 0,
          total_keywords: comp.total_keywords || 0,
          missing_keywords: comp.missing_keywords || 0,
          traffic_sum: comp.traffic_sum || 0,
          price_sum: comp.price_sum || 0
        }
      }));
    } else {
      output = [{
        json: {
          date: timestamp,
          error: 'Unknown array type',
          first_keys: Object.keys(first).join(', ')
        }
      }];
    }
  }
} else {
  output = [{
    json: {
      date: timestamp,
      error: 'Unknown structure',
      keys: Object.keys(data).join(', ')
    }
  }];
}

return output;
